		private async void CmdRemote_Clicked(object sender, EventArgs e)
		{
			if (!App.CAT1_Loggined)
			{
				LoginAlert();
				return;
			}
			RemoteRequest = false;
			if (App.SendRemote)
			{
				RemoteEnabled = false;
				App.SendRemote = false;
				EnableRemoteModify = false;
				CmdRemote.BackgroundColor = Color.Gray;
				if (App.CN)
				{
					CmdRemote.Text = "远程协助";
				}
				else
				{
					CmdRemote.Text = "Remote Help";
				}
				return;
			}
			string text = ((!App.CN) ? (await DisplayPromptAsync("RemoteHelp", "Send Local Data to Helper", "Ok", "Cancel", "Input Remoter PhoneNumber or Email", 30, null, remoteclient)) : (await DisplayPromptAsync("远程协助", "将本地控制器数据实时发送给用户", "确定", "取消", "输入对方的电话号码或者邮箱", 30, null, remoteclient)));
			if (text == null || text.Length < 5)
			{
				return;
			}
			if (text.Trim() == App.username)
			{
				if (App.CN)
				{
					UserDialogs.Instance.Alert("不能输入自己的用户名");
				}
				else
				{
					UserDialogs.Instance.Alert("You can not input your own user name");
				}
				return;
			}
			remoteclient = text;
			string payload = Encrypt(text);
			MqttPub(App.clientid + "00000000/bind/GetRemoteClient", payload);
			App.SendRemote = true;
			if (App.CN)
			{
				CmdRemote.Text = "等待应答";
			}
			else
			{
				CmdRemote.Text = "Waiting Answer";
			}
			CmdRemote.BackgroundColor = Color.LightSkyBlue;
		}

