				return;
			}
			func = 0;
			string text = FlashHex();
			if (text != "")
			{
				await UserDialogs.Instance.AlertAsync(text);
				if ((!App.CN) ? (await UserDialogs.Instance.ConfirmAsync("Select a File to Upgrade?", null, "select", "cancel")) : (await UserDialogs.Instance.ConfirmAsync("是否选择一个文件来升级", null, "选择", "取消")))
				{
					App.Downloaded = 0;
					MqttPub("000000000000000/bind/filelist", App.clientid);
					await base.Navigation.PushModalAsync(new FilePage());
				}
			}
		}

