		private async void ModifyPassword()
		{
			string text = ((!App.CN) ? (await DisplayPromptAsync("Modify Controller Password", "Please input New Password ", "OK", "Cancel", "", 13)) : (await DisplayPromptAsync("修改控制器密码", "请输入新密码", "确认", "取消", "", 13)));
			if (text == null)
			{
				return;
			}
			App.OldPhoneNumber = text;
			text = ((!App.CN) ? (await DisplayPromptAsync("Modify Controller Password", "Please Input New Password Again", "OK", "Cancel", "", 13)) : (await DisplayPromptAsync("修改控制器密码", "请再次输入新密码", "确认", "取消", "", 13)));
			if (text == null)
			{
				return;
			}
			App.Confirm_PhoneNumber = text;
			if (App.Confirm_PhoneNumber == App.OldPhoneNumber)
			{
				if (App.Confirm_PhoneNumber.Length > 0 && App.Confirm_PhoneNumber.Length < 6)
				{
					if (App.CN)
					{
						UserDialogs.Instance.Alert("密码长度6～13，可清空");
					}
					else
					{
						UserDialogs.Instance.Alert("Passwords Length should be 6～13, or empty.");
					}
					return;
				}
				char c = '°';
				App.Confirm_PhoneNumber = (char)(c + text.Length) + App.Confirm_PhoneNumber;
				App.sendconfirm = 8;
				if (App.CN)
				{
					UserDialogs.Instance.Alert(App.Confirm_PhoneNumber.ToString() + "密码已修改，请点保存");
				}
				else
				{
					UserDialogs.Instance.Alert(App.Confirm_PhoneNumber.ToString() + "Password modified，Please click Save");
				}
			}
			else if (App.CN)
			{
				UserDialogs.Instance.Alert("两次输入密码不一致.");
			}
			else
			{
				UserDialogs.Instance.Alert("Two passwords are diffrent.");
			}
		}

