					}
					byte[] array4 = new byte[10];
					for (int m = 0; m < 10; m++)
					{
						array4[m] = data[j];
						j++;
					}
					await chs.WriteAsync(array4);
					break;
				}
				case 316:
				{
					j = 0;
					for (int subpackcnt = 0; subpackcnt < 15; subpackcnt++)
					{
						byte[] array = new byte[20];
						for (int i = 0; i < 20; i++)
