							array[i] = data[j];
							j++;
						}
						await chs.WriteAsync(array);
						Thread.Sleep(10);
					}
					byte[] array2 = new byte[18];
					for (int k = 0; k < 18; k++)
					{
						array2[k] = data[j];
						j++;
					}
					await chs.WriteAsync(array2);
					break;
				}
				default:
					await chs.WriteAsync(data);
					break;
				}
			}
			catch (Exception ex)
