		private void DownloadFunction()
		{
			switch (dld_state)
			{
			case 0:
				if (App.fileName.Contains("BN485"))
				{
					SendDetectPacket485();
				}
				else if (App.fileName.Contains("BMS"))
				{
					SendDetectPacketBMS();
				}
				else
				{
					SendDetectPacket();
				}
				dld_overtime = 0;
				dld_retry = 0;
				if (App.CN)
				{
					progress.Title = "检测控制器";
				}
				else
				{
					progress.Title = "Detect...";
				}
				if (crcOK == 1)
				{
					packcnt = 54;
					subpacktotal = 54;
				}
				else if (crcOK == 2)
				{
					packcnt = 58;
					subpacktotal = 58;
				}
				else
				{
					packcnt = 0;
					subpacktotal = 0;
				}
				if (dld_DelayTime < 30)
				{
					dld_DelayTime++;
					break;
				}
				dld_DelayTime = 0;
				dld_state = 200;
				break;
			case 1:
				if (App.CN)
				{
					progress.Title = "发送数据包" + packcnt;
				}
				else
				{
					progress.Title = "Send Packet" + packcnt;
				}
				SendDataPacket();
				dld_state = 2;
				subpacktotal++;
				dld_DelayTime = 0;
				break;
			case 2:
				if (App.CN)
				{
					progress.Title = "等待应答";
				}
				else
				{
					progress.Title = "Wait Ack";
				}
				if (dld_Ack == 1)
				{
					packcnt++;
					if (App.date == 32303 || App.date == 32071)
					{
						if (packcnt >= 121)
						{
							dld_state = 3;
						}
						else
						{
							dld_state = 1;
						}
					}
					else if (App.date == 120)
					{
						if (packcnt >= 23)
						{
							dld_state = 3;
						}
						else
						{
							dld_state = 1;
						}
					}
					else if (App.date == 121)
					{
						if (packcnt >= 27)
						{
							dld_state = 3;
						}
						else
						{
							dld_state = 1;
						}
					}
					else if (App.date == 32101)
					{
						if (packcnt >= 55)
						{
							dld_state = 3;
						}
						else
						{
							dld_state = 1;
						}
					}
					else if (packcnt >= 59)
					{
						dld_state = 3;
					}
					else
					{
						dld_state = 1;
					}
					dld_overtime = 0;
					dld_retry = 0;
					dld_Ack = 0;
				}
				else if (dld_Ack == -1)
				{
					dld_Ack = 0;
					dld_retry++;
					if (dld_retry > 3)
					{
						dld_state = 4;
					}
					else
					{
						dld_state = 1;
					}
					dld_overtime = 0;
				}
				dld_overtime++;
				if (dld_overtime > 150)
				{
					dld_state = 200;
					dld_overtime = 0;
				}
				break;
			case 3:
				if (App.CN)
				{
					progress.Title = "升级完成";
				}
				else
				{
					progress.Title = "Update Successs";
				}
				dld_state = 255;
				onCancelProgess();
				break;
			case 4:
				if (App.CN)
				{
					progress.Title = "升级失败";
				}
				else
				{
					progress.Title = "Update Fail";
				}
				dld_state = 255;
				break;
			case 200:
				if (App.fileName.Contains("BN485"))
				{
					if (App.date == 120)
					{
						SendRs232Data(4, 192, 38, 38);
					}
					else
					{
						SendRs232Data(4, 191, 38, 38);
					}
				}
				else if (App.fileName.Contains("BMS"))
				{
					SendRs232Data(4, 1, 38, 38);
				}
				else
				{
					if (App.fileName.Contains("ISOLATE_"))
					{
						WriteSysCmd(15);
					}
					else if (App.fileName.Contains("CG56_"))
					{
						WriteSysCmd(16);
					}
					else
					{
						WriteSysCmd(5);
					}
					Thread.Sleep(10);
					SendRs232Data(4, 1, 38, 38);
				}
				dld_state++;
				break;
			case 201:
				dld_state = 0;
				break;
			case 254:
				if (App.CN)
				{
					progress.Title = "应答超时";
				}
				else
				{
					progress.Title = "Ack TimeOut";
				}
				dld_state = 255;
				break;
			}
			if (App.date == 120)
			{
				progress.PercentComplete = subpacktotal * 100 / 23;
			}
			else if (App.date == 32101)
			{
				progress.PercentComplete = subpacktotal * 100 / 55;
			}
			else if (App.date == 121)
			{
				progress.PercentComplete = subpacktotal * 100 / 27;
			}
			else if (App.date == 32303 || App.date == 32071)
			{
				progress.PercentComplete = subpacktotal * 100 / 121;
			}
			else
			{
				progress.PercentComplete = subpacktotal * 100 / 59;
			}
		}

