		private void initcrc()
		{
			for (uint num = 0u; num < 256; num++)
			{
				uint num2 = num;
				for (uint num3 = 0u; num3 < 8; num3++)
				{
					num2 = (((num2 & 1) == 0) ? (num2 >> 1) : ((num2 >> 1) ^ 0xEDB88320u));
