				crc32[num] = num2;
			}
		}

		public int hexstr_to_uint32(char[] str)
		{
			int num = 0;
			int num2 = 0;
			int num3 = 0;
			if (str == null)
			{
				return 0;
			}
			for (num2 = 0; str[num2] != 0; num2++)
			{
			}
			int num4 = num2;
			if (num4 > 10)
			{
				return 0;
			}
			if (str[1] == 'x' || str[1] == 'X')
			{
				int num5 = num4 - 2;
				for (num2 = 2; num2 < num4; num2++)
				{
					if (str[num2] >= '0' && str[num2] <= '9')
					{
						num3 = str[num2] - 48;
					}
					if (str[num2] >= 'A' && str[num2] <= 'F')
					{
						num3 = str[num2] - 65 + 10;
					}
					if (str[num2] >= 'a' && str[num2] <= 'f')
					{
						num3 = str[num2] - 97 + 10;
					}
					num5--;
					num += num3 << num5 * 4;
				}
			}
			else
			{
				int num5 = num4;
				for (num2 = 0; num2 < num4; num2++)
				{
					if (str[num2] >= '0' && str[num2] <= '9')
					{
						num3 = str[num2] - 48;
					}
					if (str[num2] >= 'A' && str[num2] <= 'F')
					{
						num3 = str[num2] - 65 + 10;
					}
					if (str[num2] >= 'a' && str[num2] <= 'f')
					{
						num3 = str[num2] - 97 + 10;
					}
					num5--;
					num += num3 << num5 * 4;
				}
			}
			return num;
		}

