				if (bluedevice.Name.ToUpper().Contains("YUANQU") || bluedevice.Name.ToUpper().Contains("CONTROL") || bluedevice.Name.ToUpper().Contains("BMS"))
				{
					if (bluedevice.State == DeviceState.Connected)
