		private async void DisplayData()
		{
			string text = "";
			for (int i = App.rs485start; i < App.rs485start + 800; i++)
			{
				text += $"{App.rs485data[i]:X2} ";
			}
			await DisplayPromptAsync("接收:" + App.rs485index, "段:" + App.rs485start, "OK", "Cancel", null, -1, null, text);
			App.rs485start += 800;
			if (App.rs485start > 6400)
			{
				App.rs485start = 0;
			}
		}

