					string fullName = $"{folderPath}/{remoteFileName}";
					DownloadFile downloadFile = new DownloadFile();
					downloadFile.FullName = fullName;
					downloadFile.SingleName = remoteFileName;
					Files.Add(downloadFile);
				}
			}
