		private async void DelButton_Clicked(object sender, EventArgs e)
		{
			if (selectedFile != null)
			{
				if ((!App.CN) ? (await UserDialogs.Instance.ConfirmAsync("Delect This File？", null, "Delete", "Cancel")) : (await UserDialogs.Instance.ConfirmAsync("确认删除文件？", null, "确认删除", "不删除")))
				{
					Files.Remove(selectedFile);
					File.Delete(selectedFile.FullName);
					selectedFile = null;
					App.fileName = null;
				}
			}
			else if ((!App.CN) ? (await UserDialogs.Instance.ConfirmAsync("You didn't select any file, do you want delect all Files？", null, "Delete All", "Cancel")) : (await UserDialogs.Instance.ConfirmAsync("您没有选择任何文件，确认删除所有数据文件？", null, "确认删除", "不删除")))
			{
				string[] files = Directory.GetFiles(Environment.GetFolderPath(Environment.SpecialFolder.MyDocuments), "*.*");
				for (int i = 0; i < files.Length; i++)
				{
					File.Delete(files[i]);
				}
				Files.Clear();
			}
		}

		private void RemoveButton_Clicked(object sender, EventArgs e)
		{
			RemoteFile = !RemoteFile;
