				else
				{
					CmdRemove.Text = "View Cloud Files";
				}
			}
		}

		private async void ShareButton_Clicked(object sender, EventArgs e)
		{
			if (selectedFile == null)
			{
				if (App.CN)
				{
					UserDialogs.Instance.Alert("没有选择一个数据文件");
				}
				else
				{
					UserDialogs.Instance.Alert("Select a Data File");
				}
			}
			else
			{
				ShareFile file = new ShareFile(App.fileName);
				await Share.RequestAsync(new ShareFileRequest
				{
					Title = "共享数据文件",
					File = file
				});
			}
		}

		private async void ReturnButton_Clicked(object sender, EventArgs e)
		{
			if (selectedFile == null)
			{
				if (App.CN)
				{
					UserDialogs.Instance.Alert("没有选择一个数据文件");
				}
				else
				{
					UserDialogs.Instance.Alert("Select a Data File");
				}
				await base.Navigation.PopModalAsync();
				return;
			}
			if (RemoteFile)
			{
				bool hasfile = false;
				bool flag = false;
				string[] files = Directory.GetFiles(Environment.GetFolderPath(Environment.SpecialFolder.MyDocuments), "*.*");
				for (int i = 0; i < files.Length; i++)
				{
					string text = files[i];
					int num = text.LastIndexOf('/');
					if (num >= 0)
					{
						text = text.Substring(num + 1);
					}
					if (selectedFile.SingleName == text)
					{
						hasfile = true;
						flag = ((!App.CN) ? (await UserDialogs.Instance.ConfirmAsync("Local file existed,Download and replace it？", null, "Downlaod & Replace", "Use Local File")) : (await UserDialogs.Instance.ConfirmAsync("本地有该文件，下载远程数据覆盖本地文件？", null, "覆盖本地文件", "使用本地文件")));
						break;
					}
				}
				if (hasfile)
				{
					if (flag)
					{
						App.Downloaded = 2;
					}
					else
					{
						App.Downloaded = 1;
					}
					App.fileName = selectedFile.FullName;
				}
				else
				{
					App.fileName = selectedFile.FullName;
					App.Downloaded = 2;
				}
			}
			else
			{
				App.Downloaded = 1;
			}
			await base.Navigation.PopModalAsync();
		}

