		private void WriteAddr(byte[] data, byte addr, byte len)
		{
			data[0] = 170;
			len += 4;
			data[1] = (byte)(192 + len);
			data[2] = addr;
			data[3] = addr;
			byte b = 60;
			byte b2 = 127;
			byte b3;
			for (b3 = 0; b3 < len; b3++)
			{
				int num = b ^ data[b3];
				b = (byte)(b2 ^ crctablehi[num]);
				b2 = crctablelo[num];
			}
			data[b3] = b;
			data[b3 + 1] = b2;
			MessagingCenter.Send(this, "WriteParaMeter", data);
		}

