			case 'Y':
				if ((!App.CN) ? (await UserDialogs.Instance.ConfirmAsync("Enter Non-Following Status", null, "Enter", "Cancel")) : (await UserDialogs.Instance.ConfirmAsync("即将进入取消跟随状态", null, "进入", "取消")))
