					}
					else
					{
						SendRs232Data(4, 2, 0, 0);
					}
				}
				break;
			case 'X':
				if (App.channel != 2)
				{
					SendRs232Data(4, 181, 2, 254);
					App.channel = 2;
				}
				else
				{
					SendRs232Data(4, 181, 1, byte.MaxValue);
					App.channel = 1;
				}
				break;
			default:
			{
				int num = c - 65;
				SendRs232Data(4, 181, 3, (byte)num);
				break;
			}
			}
		}

