		private void DIR_Clicked(object sender, EventArgs e)
		{
			if (!NotBindingStat() && !NotOwnerStat())
			{
				int num = 1;
				if (DIRStat.IsToggled)
				{
					num = 0;
				}
				int num2 = num + 1;
				if (App.NewVersion)
				{
					WriteAddr(new byte[8]
					{
						0,
						0,
						0,
						0,
						cfg11l,
						(byte)((cfg11h & 0x7F) + (num << 7)),
						0,
						0
					}, 11, 2);
				}
				else
				{
					SendRs232Data(18, 7, (byte)num2, (byte)(num2 >> 8));
				}
			}
		}

