		private void SetEnergeCoeff(int value)
		{
			if (NotBindingStat() || NotOwnerStat())
			{
				return;
			}
			try
			{
				for (int i = 0; i < 10; i++)
				{
					int num = rcv_RatedSpeed * rcv_RatedVoltage * 11 / 648000;
					int num2 = value;
					int num3 = value;
					if (i > num)
					{
						num2 = value * 3 / 4;
						num3 = value / 2;
					}
					if (i > num + 1)
					{
						num2 = value / 4;
						num3 = value / 8;
					}
					if (i > num + 2)
					{
						num2 = 0;
						num3 = 0;
					}
					if (App.NewVersion)
					{
						WriteAddr(new byte[8]
						{
							0,
							0,
							0,
							0,
							(byte)num2,
							(byte)num3,
							0,
							0
						}, (byte)(146 + i), 2);
					}
					else
					{
						SendRs232Data(16, 1, (byte)value, (byte)(value >> 8));
					}
					Thread.Sleep(10);
				}
				for (int j = 0; j < 10; j++)
				{
					int num4 = rcv_RatedSpeed * rcv_RatedVoltage * 11 / 648000;
					int num5 = value;
					int num6 = value;
					if (j > num4)
					{
						num5 = value * 3 / 4;
						num6 = value / 2;
					}
					if (j > num4 + 1)
					{
						num5 = value / 4;
						num6 = value / 8;
					}
					if (j > num4 + 2)
					{
						num5 = 0;
						num6 = 0;
					}
					if (App.NewVersion)
					{
						WriteAddr(new byte[8]
						{
							0,
							0,
							0,
							0,
							(byte)num5,
							(byte)num6,
							0,
							0
						}, (byte)(146 + j), 2);
					}
					else
					{
						SendRs232Data(16, 1, (byte)value, (byte)(value >> 8));
					}
					Thread.Sleep(10);
				}
				for (int k = 0; k < 10; k++)
				{
					int num7 = rcv_RatedSpeed * rcv_RatedVoltage * 11 / 648000;
					int num8 = value;
					int num9 = value;
					if (k > num7)
					{
						num8 = value * 3 / 4;
						num9 = value / 2;
					}
					if (k > num7 + 1)
					{
						num8 = value / 4;
						num9 = value / 8;
					}
					if (k > num7 + 2)
					{
						num8 = 0;
						num9 = 0;
					}
					if (App.NewVersion)
					{
						WriteAddr(new byte[8]
						{
							0,
							0,
							0,
							0,
							(byte)num8,
							(byte)num9,
							0,
							0
						}, (byte)(146 + k), 2);
					}
					else
					{
						SendRs232Data(16, 1, (byte)value, (byte)(value >> 8));
					}
					Thread.Sleep(10);
				}
			}
			catch (FormatException)
			{
			}
		}

