		private void Analyze(byte a, byte b)
		{
			analyzenum = 0;
			if (keystat0 != a)
			{
				for (int i = 0; i < 8; i++)
				{
					byte num = (byte)((keystat0 >> i) & 1);
					byte b2 = (byte)((a >> i) & 1);
					if (num != b2)
					{
						analyzenum = i;
						break;
					}
				}
				progress.PercentComplete += 10;
				keystat0 = a;
			}
			if (keystat1 != b)
			{
				for (int j = 0; j < 8; j++)
				{
					byte num2 = (byte)((keystat1 >> j) & 1);
					byte b3 = (byte)((b >> j) & 1);
					if (num2 != b3)
					{
						analyzenum = j + 8;
						break;
					}
				}
				progress.PercentComplete += 10;
				keystat1 = b;
			}
			if (progress.PercentComplete >= 100)
			{
				onCancelProgess();
				ConfirmProgess(analyzenum);
			}
		}

