		private async void BindA()
		{
			if ((!App.CN) ? (await UserDialogs.Instance.ConfirmAsync("Controller is not bound or login, Please bind or login the controller.", null, "Bind", "Cancel")) : (await UserDialogs.Instance.ConfirmAsync("控制器未绑定登录，请先绑定登录控制器。", null, "绑定", "取消")))
			{
				App.NotBindStat = 99;
			}
		}

		private bool NotBindingStat()
		{
			if (App.RcvRemoteCount > 0 && !App.isConnected)
			{
				return false;
			}
			if (App.PassOk == 0 || (App.BindingStat < 0 && App.PassOk == 1))
			{
				BindA();
				return true;
			}
			return false;
		}

		private async void BindC()
		{
			if ((!App.CN) ? (await UserDialogs.Instance.ConfirmAsync("Controller is not bound, to protect parameters from being modified by others, it is recommended to bind the controller.", null, "Bind", "Cancel")) : (await UserDialogs.Instance.ConfirmAsync("控制器未绑定，为了保护参数不被他人修改，建议绑定控制器。", null, "绑定", "取消")))
			{
				App.NotBindStat = 99;
			}
		}

		private bool NotOwnerStat()
		{
			if (App.RcvRemoteCount > 0 && !App.isConnected)
			{
				return false;
			}
			if (App.ownertype <= 1)
			{
				if (App.PassOk == 2)
				{
					if (App.NotBindStat >= 1 && App.NotBindStat < 100)
					{
						App.NotBindStat++;
						BindC();
						return true;
					}
					return false;
				}
				if (App.CN)
				{
					UserDialogs.Instance.Alert("只有主用户和工厂用户才能修改这个参数！");
				}
				else
				{
					UserDialogs.Instance.Alert("Only master and factory users can modify this parameter.");
				}
				return true;
			}
			return false;
		}

		private async void MaxDSGCurr_TextChanged(object sender, EventArgs e)
		{
			if (NotBindingStat() || NotOwnerStat())
			{
				return;
			}
			PromptResult promptResult = await UserDialogs.Instance.PromptAsync(new PromptConfig
			{
				InputType = InputType.Name,
				OkText = "OK",
				CancelText = "Cancel",
				Title = MaxDSGCurr.Text
			});
			if (!promptResult.Ok || string.IsNullOrWhiteSpace(promptResult.Text))
			{
				return;
			}
			string text = promptResult.Text;
			text = text.TrimEnd(new char[1] { 'A' });
			text = text.TrimEnd(new char[1] { 'a' });
			try
			{
				int num = Convert.ToInt16(text);
				num *= 10;
				SendRs232Data(18, 1, (byte)num, (byte)(num >> 8));
			}
			catch (FormatException)
			{
				UserDialogs.Instance.Toast("FormatException Input");
			}
		}

