		private async void ButtonSaveName_Clicked(object sender, EventArgs e)
		{
			if (!NotBindingStat() && !NotOwnerStat() && ((!App.CN) ? (await UserDialogs.Instance.ConfirmAsync("Will Save Controller Data", null, "Save", "Cancel")) : (await UserDialogs.Instance.ConfirmAsync("即将保存bms数据", null, "保存", "取消"))))
			{
				DateTime now = DateTime.Now;
				SendRs232Data(21, (byte)(now.Hour + 1), (byte)(now.Minute + 1), (byte)(now.Second + 1));
