		private async void SpeedMeterConfig_SelectedIndexChanged(object sender, EventArgs e)
		{
			if (NotBindingStat() || NotOwnerStat())
			{
				return;
			}
			string text = ((!App.CN) ? (await DisplayActionSheet("Speedometer Mode:", "cancel", "0-Pulse", "1-Analog", "2-Isolated Pulse")) : (await DisplayActionSheet("速度表方式:", "cancel", "0-脉冲", "1-模拟", "2-速度脉冲")));
			if (!(text != "cancel") || string.IsNullOrWhiteSpace(text))
			{
				return;
			}
			text = text.Substring(0, 1);
			int num = Convert.ToInt16(text);
			if (App.NewVersion)
			{
				byte[] array = new byte[8]
				{
					0,
					0,
					0,
					0,
					(byte)rconfig_word0,
					0,
					0,
					0
				};
				switch (num)
				{
				case 0:
					array[5] = (byte)(rconfig_word1 & 0xFC);
					break;
				case 1:
					array[5] = (byte)((rconfig_word1 & 0x7E) + 129);
					break;
				default:
					array[5] = (byte)((rconfig_word1 & 0xFC) + 3);
					break;
				}
				WriteAddr(array, 124, 2);
			}
			else
			{
				switch (num)
				{
				case 0:
					num |= 0x101;
					num &= 0x7DFF;
					break;
				case 1:
					num |= 0x8101;
					num &= 0xFDFF;
					break;
				default:
					num |= 0x301;
					num &= 0x7FFF;
					break;
				}
				SendRs232Data(17, 5, (byte)num, (byte)(num >> 8));
			}
		}

