		public int hexstr_to_uint32(string str)
		{
			int num = 0;
			int num2 = 0;
			int num3 = 0;
			if (str == null)
			{
				return 0;
			}
			int length = str.Length;
			if (length > 10 || length == 0)
			{
				return 0;
			}
			if (length > 1)
			{
				if (str[1] == 'x' || str[1] == 'X')
				{
					int num4 = length - 2;
					for (num2 = 2; num2 < length; num2++)
					{
						if (str[num2] >= '0' && str[num2] <= '9')
						{
							num3 = str[num2] - 48;
						}
						if (str[num2] >= 'A' && str[num2] <= 'F')
						{
							num3 = str[num2] - 65 + 10;
						}
						if (str[num2] >= 'a' && str[num2] <= 'f')
						{
							num3 = str[num2] - 97 + 10;
						}
						num4--;
						num += num3 << num4 * 4;
					}
				}
				else
				{
					int num4 = length;
					for (num2 = 0; num2 < length; num2++)
					{
						if (str[num2] >= '0' && str[num2] <= '9')
						{
							num3 = str[num2] - 48;
						}
						if (str[num2] >= 'A' && str[num2] <= 'F')
						{
							num3 = str[num2] - 65 + 10;
						}
						if (str[num2] >= 'a' && str[num2] <= 'f')
						{
							num3 = str[num2] - 97 + 10;
						}
						num4--;
						num += num3 << num4 * 4;
					}
				}
			}
			else
			{
				if (str[0] >= '0' && str[0] <= '9')
				{
					num3 = str[0] - 48;
				}
				if (str[0] >= 'A' && str[0] <= 'F')
				{
					num3 = str[0] - 65 + 10;
				}
				if (str[0] >= 'a' && str[0] <= 'f')
				{
					num3 = str[0] - 97 + 10;
				}
				num += num3;
			}
			return num;
		}

