				num7 *= num15;
				num11 -= num6;
				num14 -= num7;
				if (num11 != 0.0)
				{
					num12 -= num11 * num9;
					num14 -= num11 * num10;
				}
				array[num3, 0] = num6;
				array[num3, 1] = 0.0;
				array[num3, 2] = num7;
				num3++;
				array[num3, 0] = num8;
				array[num3, 1] = num9;
				array[num3, 2] = num10;
				num3++;
				if (num3 >= num2 - 2)
				{
					break;
				}
				num5 = num12;
				num6 = num13;
				num7 = num14;
				num8 = 1.0;
				num9 = 1.0;
				num10 = 2.0 * V[num4++];
				num11 = -2.0;
				num12 = 2.0;
				num13 = -1.0;
				num14 = 0.0;
			}
			num5 = num12;
			num6 = num13;
			num7 = num14;
			num8 = 2.0;
			num9 = 0.0;
			num10 = V[num4++];
			num15 = 1.0 / num5;
			num6 *= num15;
			num7 *= num15;
			num8 += num6;
			num10 += num7;
			num10 /= num8;
			num8 = 1.0;
			array[num3, 0] = num6;
			array[num3, 1] = 0.0;
			array[num3, 2] = num7;
			num3++;
			array[num3, 0] = num8;
			array[num3, 1] = num9;
			array[num3, 2] = num10;
			num3++;
			num4--;
			while (num3 > 0)
			{
				num3--;
				if (num3 < num2 - 1)
				{
